import React, { useState, useEffect } from 'react';
import './App.css';

interface Props {
    todos: Todo[];
}

export const Todos: React.FC<Props> = ({ todos }) => {
  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    let response = await (
      await fetch("http://localhost:8080/state/all")
    ).json();
    setTodos(response);
  };


  return (
    <>
        {todos.map(todo => (
        <li>
            <label style={{ textDecoration: todo.complete ? 'line-through' : undefined }}>
                <input onChange={()=>{}} type="checkbox" checked={todo.complete} onClick={() => {changeTodos(todo);}}/> {todo.text} - {todo.id}
            </label>
        </li>
        ))}
    </>
  );
};
